	private createRoom (
		buildingFullName: string,
		buildingShortName: string,
		roomNumber: string,
		roomName: string,
		buildingAddress: string,
		lat: string,
		lon: string,
		roomCapacity: string,
		roomType: string,
		roomFurniture: string,
		roomLink: string
	): Room {
		return new Room (
			buildingFullName,
			buildingShortName,
			roomNumber,
			roomName,
			buildingAddress,
			Number(lat),
			Number(lon),
			Number(roomCapacity),
			roomType,
			roomFurniture,
			roomLink
		);
	}
